const myImage = new Image();
myImage.src = "data:image/jpeg;base64,";


myImage.addEventListener('load', function () {
    const canvas1 = document.getElementById('canvas1');
    const ctx = canvas1.getContext('2d');

    canvas1.width = 280;
    canvas1.height = 190;

    ctx.drawImage(myImage, 0, 0, canvas1.width, canvas1.height);
    const pexels = ctx.getImageData(0, 0, canvas1.width, canvas1.height);
    ctx.clearRect(0, 0, canvas1.width, canvas1.height);

    let particleArray = [];
    const numberOfParticles = 2000;

    let mappedImage = [];
    for (let y = 0; y < canvas1.height; y++) {
        let row = [];
        for (let x = 0; x < canvas1.width; x++) {
            const red = pexels.data[(y * 4 * pexels.width) + (x * 4)];
            const green = pexels.data[(y * 4 * pexels.width) + (x * 4 + 1)];
            const blue = pexels.data[(y * 4 * pexels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }
    console.log(mappedImage);

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        ) / 100;
    }

    class Particles {
        constructor() {
            this.x = Math.random() * canvas1.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 1;
            this.size = Math.random() * 2.5;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }

        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (5 - this.speed) + this.velocity;

            this.y += movement;
            if (this.y > canvas1.height) {
                this.y = 0;
                this.x = Math.random() * canvas1.width;
            }
        }

        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'green';
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();


        }
    }


    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particleArray.push(new Particles());
        }
    }
    init();

    function animate() {

        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0, 0, 0)';
        ctx.fillRect(0, 0, canvas1.width, canvas1.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particleArray.length; i++) {
            particleArray[i].update();
            ctx.globalAlpha = particleArray[i].speed * 0.5;
            particleArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

});